  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115006 includes chemical,
  discrete sample, physical and profile data collected from HUDSON in the Davis Strait,
  Gulf of St. Lawrence, Labrador Sea and North Atlantic Ocean from 1995-06-07 to 1995-07-05
  and retrieved during cruise WOCE_A01W. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
  tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, WATER TEMPERATURE and methyl chloroform (MC). The instruments
  used to collect these data include CTD and bottle. These data were collected by
  Peter E. Jones of Bedford Institute of Oceanography as part of the WOCE_A01W data
  set.nnThe World Ocean Circulation Experiment (WOCE) was a major component of the
  World Climate Research Program with the overall goal of better understanding the
  ocean's role in climate and climatic changes resulting from both natural and anthropogenic
  causes. The CO2 survey took advantage of the sampling opportunities provided by
  the WOCE Hydrographic Program (WHP) cruises during this period between 1990 and
  1998. The final collection covers approximately 23,000 stations from 94 WOCE cruises.\",\n\t\"owner_org\":
